import React, { Component } from 'react';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';

import MenuIcon from '@material-ui/icons/Menu';
import { IconButton, TableRow, Container} from '@material-ui/core';
import { MenuItem,Menu} from 'material-ui';

class Navbar extends Component {

    menuState={
        anchorEl:null,
        setAnchorEl:null
    }

   handleClick = (event) => {
       this.setState({ setAnchorEl:event.currentTarget});
      };
    
     handleClose = () => {

        this.setState({ setAnchorEl:null});
      };

    render() {
        return (
            <div>
                
                    <AppBar position="static">
                        <Toolbar class="navbar navbar-dark bg-dark">
                            
                            <Typography variant="h6" >EGBA SİSTEM
                              
                            </Typography>
                            <IconButton edge="end"  color="inherit" aria-label="menu">
                                <MenuIcon />
                            </IconButton>
                            <Menu 
                            id="menu-appbar"
                            
                            anchorEl={this.menuState.anchorEl}
                            keepMounted
                            open={Boolean(this.menuState.anchorEl)}
                            onClose={this.handleClose}
                            >
                                <MenuItem onClick={this.handleClose}>Profile</MenuItem>
        <MenuItem onClick={this.handleClose}>My account</MenuItem>
        <MenuItem onClick={this.handleClose}>Logout</MenuItem>
                            </Menu>
                            <Button color="inherit">Çıkış</Button>
                        </Toolbar>
                    </AppBar>
                   
                    
                
            </div>
        )
    }
}
export default Navbar;
